# Prediction: argmax(softmax_out)
    la t0, softmax_out           # base address
    li t1, 10
    li t2, 0                   # max_index = 0
    flw ft0, 0(t0)             # max_val = softmax_out[0]
    li t3, 1
    la s0, result

argmax_loop:
    bge t3, t1, print_result
    slli t4, t3, 2
    add t5, t0, t4
    flw ft1, 0(t5)
    flt.s t6, ft0, ft1         # if ft0 < ft1
    beqz t6, next_elem
    fsgnj.s ft0, ft1, ft1      # ft0 = ft1
    mv t2, t3                  # max_index = t3
next_elem:
    addi t3, t3, 1
    j argmax_loop


print_result:
sw t2, 0(s0)
la a0, result
lw a1, size
#call printToLogVectorized


j _finish

conv2d:
    li s0, 0                  # f = 0
    li s6, 8
filter_loop:
    bge s0, s6, end_conv

    # Load bias: ft2 = b_conv[f]
    slli t0, s0, 2
    add t1, a3, t0
    flw ft2, 0(t1) 

    li s1, 0                  # i = 0
    li s7, 24
i_loop:
    bge s1, s7, next_filter
    li s2, 0                  # j = 0
j_loop:
    bge s2, s7, next_i

    # Load 5×5 patch into v1
    la t2, temp_patch
    li s3, 0                  # ki = 0
    li s8, 5
patch_loop:
    bge s3, s8, load_weights

    li s4, 0                  # kj = 0
patch_inner:
    bge s4, s8, next_ki

    # offset = (i+ki) * IMG_SIZE + (j+kj)
    li s11, 28
    add t3, s1, s3
    mul t3, t3, s11
    add t4, s2, s4
    add t3, t3, t4
    slli t3, t3, 2
    add t5, a0, t3
    flw ft0, 0(t5)

    # Store ft0 into temp_patch at position [ki * 5 + kj]
    li s10, 5
    mul t6, s3, s10         # t6 = ki * 5
    add t6, t6, s4         # t6 = ki*5 + kj
    slli t6, t6, 2         # t6 = (ki * 5 + kj) * 4 (byte offset)
    add s9, t2, t6         # t7 = address of temp_patch[ki*5 + kj]
    fsw ft0, 0(s9)


    addi s4, s4, 1
    j patch_inner
next_ki:
    addi s3, s3, 1
    j patch_loop

load_weights:
    vsetvli t0, zero, e32, m1
    vle32.v v1, (t2)                         # v1 = patch
    li t1, 25
    mul t1, s0, t1
    slli t1, t1, 2
    add t2, a2, t1
    vle32.v v2, (t2)                         # v2 = filter[f]

    # calculate address: output[f][i][j]
    li t0, 24
    mul t1, s0, t0
    add t1, t1, s1
    mul t1, t1, t0
    add t1, t1, s2
    slli t1, t1, 2
    add t2, a1, t1          # t2 = address of output[f][i][j]

   # vector multiply and reduce
    vfmul.vv v3, v1, v2
    fmv.s.x ft1, zero
    vfmv.v.f v4, ft1
    vfredsum.vs v4, v3, v4
    vfmv.f.s ft0, v4

# apply bias and ReLU
    fadd.s ft0, ft0, ft2
    fmax.s ft0, ft0, ft1

# store output
    fsw ft0, 0(t2)


    addi s2, s2, 1
    j j_loop
next_i:
    addi s1, s1, 1
    j i_loop
next_filter:
    addi s0, s0, 1
    j filter_loop
end_conv:
    ret



maxpool2d:
    li t0, 0              # f = 0
    li s0, 8              # NUM_FILTERS
mp_filter:
    bge t0, s0, mp_done

    li t1, 0              # i = 0
    li s1, 12             # Output size: 12
mp_i:
    bge t1, s1, next_f
    li t2, 0              # j = 0
mp_j:
    bge t2, s1, next_mi

    # Get base offset in input
    slli t3, t1, 1        # i*2
    slli t4, t2, 1        # j*2
#   4 + i * 2) * 24
    # add t6, t6, t4        # + j*2
    li t5, 24                   # t5 = 24

    # t6 = f * 24 * 24
    mul t6, t0, t5              # t6 = f * 24
    mul t6, t6, t5              # t6 = f * 24 * 24

    # t3 = i * 2
    slli t3, t1, 1              # t3 = i * 2
    mul t4, t3, t5              # t4 = i * 2 * 24

    # t3 = j * 2
    slli t3, t2, 1              # t3 = j * 2

    # Final offset = f*24*24 + i*2*24 + j*2
    add t6, t6, t4              # t6 = f*24*24 + i*2*24
    add t6, t6, t3              # t6 += j*2


#--------------------------------
    slli t6, t6, 2        # * 4 (bytes)
    add s2, a0, t6        # input offset -> s2

    # Load 4 floats manually
    flw ft6, 0(s2)        # max_val = input[f][i*2][j*2]
    flw ft1, 4(s2)        # input[f][i*2][j*2 + 1]
    fmax.s ft6, ft6, ft1

    addi s3, s2, 24 * 4   # Move to next row
    flw ft2, 0(s3)        # input[f][i*2 + 1][j*2]
    fmax.s ft6, ft6, ft2

    flw ft3, 4(s3)        # input[f][i*2 + 1][j*2 + 1]
    fmax.s ft6, ft6, ft3

    # Store to output[f][i][j]
    li s4, 12             # Output size: 12
    mul s5, t0, s4        # f * 12
    add s5, s5, t1        # + i
    mul s5, s5, s4        # (f * 12 + i) * 12
    add s5, s5, t2        # + j
    slli s5, s5, 2        # * 4 (bytes)
    add s6, a1, s5        # output offset -> s6
    fsw ft6, 0(s6)        # output[f][i][j] = max_val

    addi t2, t2, 1
    j mp_j
next_mi:
    addi t1, t1, 1
    j mp_i
next_f:
    addi t0, t0, 1
    j mp_filter

mp_done:
    ret
    
# Final Verified Dense Layer (10 outputs only)
# a0: input (1152), a1: output (10), a2: weights (10x1152), a3: biases (10)
dense:
    li t0, 0              # i = 0 (output index)
    li s0, 10             # Strict 10 output limit
    fmv.s.x ft0, zero     # Zero constant
    
dense_loop:
    bge t0, s0, dense_done
    
    # Initialize accumulator
    fmv.s.x ft1, zero     # sum = 0.0
    
    # Setup pointers
    mv t1, a0             # input ptr
    li t2, 1152
    mul t3, t0, t2        # i * 1152
    slli t3, t3, 2        # byte offset
    add t4, a2, t3        # weight ptr
    
    li t5, 0              # j = 0
inner_loop:
    bge t5, t2, end_inner
    
    flw ft2, 0(t1)        # input[j]
    flw ft3, 0(t4)        # W[i][j]
    fmadd.s ft1, ft2, ft3, ft1
    
    addi t1, t1, 4
    addi t4, t4, 4
    addi t5, t5, 1
    j inner_loop

end_inner:
    # Add bias
    slli t6, t0, 2
    add t6, a3, t6
    flw ft4, 0(t6)        # b[i]
    fadd.s ft5, ft1, ft4
    
    # Store only to the 10-output buffer
    slli t6, t0, 2
    add t6, a1, t6
    fsw ft5, 0(t6)
    
    addi t0, t0, 1
    j dense_loop

dense_done:
    ret

softmax:
    li a2, 10
    vsetvli t0, a2, e32, m1      # Set VL based on input size
    vle32.v v1, (a0)             # Load dense_out[] → v1

    # --- Compute exp(x) approximation: exp(x) ≈ 1 + x + 0.5x^2 + 0.1667x^3 ---

    vfmul.vv v2, v1, v1          # v2 = x^2
    vfmul.vv v3, v2, v1          # v3 = x^3

    li t1, 0x3f000000            # 0.5f
    fmv.w.x ft1, t1
    vfmul.vf v2, v2, ft1         # v2 = 0.5 * x^2

    li t2, 0x3e2aaaab            # ~0.166666f
    fmv.w.x ft2, t2
    vfmul.vf v3, v3, ft2         # v3 = 0.1667 * x^3

    vfadd.vv v4, v1, v2          # v4 = x + 0.5x^2
    vfadd.vv v4, v4, v3          # v4 = x + 0.5x^2 + 0.1667x^3

    li t0, 0x3f800000       
    fmv.w.x ft3, t0         
    vfmv.v.f v5, ft3        
    vfadd.vv v6, v4, v5          # v6 ≈ exp(x)

    # --- Sum of exp(x) ---
    fmv.s.x ft0, zero
    vfmv.v.f v7, ft0
    vfredsum.vs v8, v6, v7       # v8[0] = sum of v6
    vfmv.f.s ft1, v8             # ft1 = sum

    # --- Normalize ---
    vfdiv.vf v9, v6, ft1         # v9 = exp(x) / sum
    vse32.v v9, (a1)             # store back to a0
    ret


# Function: print
# Logs values from array in a0 into registers v1 for debugging and output.
# Inputs:
#   - a0: Base address of array
#   - a1: Size of array i.e. number of elements to log
# Clobbers: t0,t1, t2,t3 ft0, ft1.
printToLogVectorized:        
    addi sp, sp, -4
    sw a0, 0(sp)

    li t0, 0x123                 # Pattern for help in python script
    li t0, 0x456                 # Pattern for help in python script
    mv a1, a1                   # moving size to get it from log 
    # mul a1, a1, a1              # sqaure matrix has n^2 elements 
	li t0, 0		                # load i = 0
    printloop:
        vsetvli t3, a1, e32         # Set VLEN based on a1
        slli t4, t3, 2                # Compute VLEN * 4 for address increment

        vle32.v v1, (a0)              # Load real[i] into v1
        add a0, a0, t4                # Increment pointer for real[] by VLEN * 4
        add t0, t0, t3                # Increment index

        bge t0, a1, endPrintLoop      # Exit loop if i >= size
        j printloop                   # Jump to start of loop
    endPrintLoop:
    li t0, 0x123                    # Pattern for help in python script
    li t0, 0x456                    # Pattern for help in python script
	
    lw a0, 0(sp)
    addi sp, sp, 4

	jr ra



# Function: _finish
# VeeR Related function which writes to to_host which stops the simulator
_finish:
    li x3, 0xd0580000
    addi x5, x0, 0xff
    sb x5, 0(x3)
    beq x0, x0, _finish

    .rept 100
        nop
    .endr


